&quot;Just as the main tourist road to Jenolan Caves crosses Cox's River beyond Hartley, New South Wales, it passed an historic camping ground. Here on the flats where above its junction with the River Lett the stream breaks past granite boulders, the spot now long known as Glenroy was a haven for all who travelled on the original road to the Bathurst Plains.&quot;

Source: &quot;Historic Glenroy and Cox's River, Hartley NSW&quot;

